import React from 'react';
import './App.css';
import logo from './main-logo.png';
import Button from '@mui/material/Button';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} alt="mainlogo" />
      </header>
      <div>
      <Button variant="contained">Hello World</Button>
      </div>
    </div>
  );
}

export default App;
